import ibanez from './../../img/products/Ibanez.png'
import toCart from './../../img/products/ToCart.png'
import yamaha from './../../img/products/Yamaha.png'

const Card = (props) => {
    console.log(props.title);
    return(
        <div className="card">
            
                <div className="img">
                    <img src={ibanez} alt='products' />
                </div>
                <p>Электрогитара</p>

                        <a>{props.title}</a>
                        <b>{props.price} руб.</b>
            
                    <button className="add">
                        <img src={toCart} ></img>
                    </button>
                
            </div>
    );
}

export default Card;
